import React from "react";
import Club from "./Club";
const listClubs = (props) => {
  console.log(props);
  const indexClubs = props.map((item, i) => {
    <li key={i}></li>;
  });

  return (
    <ul>
      <Club title={indexClubs} />
    </ul>
  );
};

export default listClubs;
